        gap: 10px;
        // grid-template-columns: minmax(150px, 150px) !important;
        grid-template-columns: minmax(50px, auto) !important;

        .product-list-image {
            grid-row: 2;
            width: max-content;
            grid-column-start: 1;

            img {
                width: 60px;
            }
        }

        .product-list-title {
            width: min-content;
        }

        .product-list-stock {
            grid-column-start: 1;
            grid-row: 2;
            width: min-content;
            margin-left: 70px;

            .stock-alert {
                width: max-content;
            }

            .warning {
                width: max-content;
            }
        }

        .product-list-qty {
            grid-row: 3;
        }

        .product-list-cart {
            grid-column-start: 2;
            grid-row: 3;
        }

        .product-list-total {
            grid-row: 2;
            grid-column-start: 2;
            margin-left: 70px;
        }

        .product-list-price {
            grid-row: 2;
            grid-column-start: 2;
            width: min-content;
        }
    }
