        grid-template-columns: minmax(100px, auto) !important;
        padding: 10px;

        .product-list-title {
            width: initial;
        }
        .product-list-price {
            margin-left: 25px;
        }

        .product-list-name {
            margin-left: 25px;
        }
    }

}

